(727, 165, 'AVM Fritz! WLAN USB Stick', 0, 0, 'Über den Fritz!WLAN-Stick verbinden Sie PC oder Notebook auf denkbar einfachste Weise mit dem vorhandenen drahtlosen Netzwerk.\r\n\r\nEinfach den Stick in den USB-Port stecken. Die Installation erfolgt vollautomatisch. \r\n\r\nGeeignet zur Verbindung mit allen Access-Points und WLAN-Routern.\r\n\r\nStick & Surf! Wenn Sie eine Fritz!Box besitzen, übernimmt der Stick sogar die Sicherheitseinstellungen der Box. So ist Ihre Verbindung sofort automatisch verschlüsselt und gut geschützt.\r\n\r\nSchön für stationäre PCs unterm Tisch, deren USB-Anschlüsse nicht direkt erreichbar sind: Eine Verlängerung mit USB-Standfuß ist im Lieferumfang.\r\n\r\nMaximale Sicherheit: Verschlüsselt durch WPA2 (802.11i)\r\n\r\nFunktionsanzeige über 2 LEDs\r\n\r\nMaße: 53 x 20 x 11 mm\r\n\r\nSystemvoraussetzung: Windows XP ab SP2/Vista/7\r\n\r\nMit Software zur Steuerung der WLAN-Verbindung und zur Anpassung der Sicherheits-Optionen\r\n\r\nInkl. USB-Standfuß mit Kabel (90 cm), deutschem Handbuch', 42, 108, 14, ''),
