(793, 177, ' F-Stecker Montage-Werkzeug', 1, 0, 'Montage-Werkzeug für Koaxialkabel, F-Stecker und \r\nAbisolierer für Koaxial-Kabel.\r\n\r\nAbisolieren aller gängigen Koax-Kabel ohne Beschädigung der Abschirmung oder des Innenleiters. Der Querschnitt ist einstellbar für Koaxkabel mit Durchmesser von 4mm bis 8,2mm.\r\n\r\nF-Knebel - Aufdrehhilfe für F-Stecker aus Edelstahl. \r\n\r\nHilfswerkzeug zur Montage von F-Steckern auf Koax/SAT-Kabel.\r\n\r\nF-Stecker-Montageschlüssel - Montagehilfe zum Festschrauben von F-Steckern auf Anschlüssen am LNB, Multischaltern oder anderen Anlagenkomponenten mit F-Anschluss.\r\n\r\n\r\n\r\n    Abisolierer für Koaxial-Kabel, rot\r\n    F-Knebel | Aufdrehhilfe für F-Stecker\r\n    F-Montageschlüssel für F-Stecker\r\n ', 66, 141, 28, 'keine'),
