(807, 165, 'LSA Auflegewerkzeug', 1, 0, 'Zur Installation von LAN-Kabeln im Patchfeld oder Dose\r\nBeschreibung\r\n\r\nDieses Logilink-Werkzeug sollte bei keinem Netzwerk-Spezialisten fehlen, denn Sie können damit Twisted Pair-Kabel ganz einfach in nur 4 Schritten auf LSA-Leisten wie z. B. Patch-Panels und Wanddosen professionell installieren. Beim Auflegen der Kabel werden überstehende Kabelreste automatisch abgeschnitten.\r\n', 66, 141, 13, 'WZ0001A '),
