(815, 197, 'YAESU FT-101 TRX', 1, 0, 'Amateurfunk-Transceiver\r\nBänder: 80/40/20/15/10m\r\nOutput: 100W pep\r\nBetriebsarten: A1 (CW), A3j (SSB), A3 (AM).\r\nTechnik: Doppelüberlagerungsprinzip.\r\nUser- und Service-Manual vorhanden', 66, 142, 7, '14.08.2011'),
(816, 197, 'R&S HF/DC-Millivoltmeter URV 216.3612.02', 1, 0, 'Rohde & Schwarz HF-DC reparaturbedürftig\r\n\r\nMillivoltmeter mit zwei Eingängen, AC/DC Bereiche, hohe Empfindlichkeit für Gleich- und\r\nWechselspannung; kleinster\r\nTeilbereich 3 mV Vollausschlag;\r\nGrundfehler nur 2% für HF-Messung,\r\n1% für DC-Messung;\r\nZwei Messkopf-Eingänge, dadurch\r\nbequeme Vierpolmessung Maße/ Dimensions : 162mm (B/W) x 238mm (H/H) x 275mm (T/D)\r\nGewicht/ Weight: 4 kg, netzunabhängig, Batteriebetrieb 6 x Mono\r\n\r\n1XZubehör: 60Ohm / 15V 7/16'' Spinner \r\nHF-Durchgangskopf 243.9418.64\r\ndBm-Anzeige (Referenz: 1mW an 600Ohm) Messungen  rückwirkungsfrei bis 50MHz auich im 60Ohm-System', 66, 142, 7, '03.09.2011'),
(817, 197, 'R&S UHF-Durchgangskopf URV 15V- 60 Ohm', 1, 0, 'Rohde & Schwarz 60Ohm / 15V 7/16'' Spinner HF-Durchgangskopf 243.9418.64, 1kHz - 1600MHz 243.9418.64', 66, 142, 7, '03.09.2011'),
(818, 197, 'R&S HF-Millivoltmeter URV4 Grundgerät', 1, 0, 'Rohde & Schwarz URV4 BN292.5012.03 Grundgerät für Handmessungen ohne Zubehör, dBm-Anzeige (Referenz: 1mW an 50 Ohm)\r\n\r\nMeasurements Readout mode: voltage and level (dBm)\r\n- Frequency range: 10 kHz to 2 GHz\r\n- Voltage range: 700 &#181;V to 1000 V\r\n- Level range: - 50 dBm to +73 dBm\r\n\r\nDas URV 4 ist ein hochempfindliches und genaues HF-Millivoltmeter von Rohde & Schwarz zur Spannungsmessung im Bereich 10 kHz ... 2 GHz (als Indikator auch bis 3 GHz verwendbar). \r\nSpannungsmeßbereich von 700 uV bis 1000V entsprechend -50 bis +73dBm (mit Vorsteckteiler) . \r\nFrequenzbereich und Spannungsmessungen abhängig vom angeschlossenen Messkopf. \r\n\r\nHohe Empfindlichkeit Auflösung max. 1uV, entsprechend max. 0,01dB. \r\nMesswertanzeige digital, Messbereichswahl automatisch, auf Hand umschaltbar.\r\n\r\nZusätzliche analoge Tendenzanzeige mit  LED-Zeile für Abgleicharbeiten. \r\n\r\nDurch Tastendruck elektrische Nullpunktsuche durch Nullpunktautomatik im empfindlichsten Messbereich. \r\n\r\nVersion 292.5012.03 mit IEC-Bus-Schnittstelle fernsteuerbar. Stromversorgung  aus dem Netz, auch mit externer Batterie (11..28 V) möglich. \r\n\r\nMaße/mm: 240x109x217, Gewicht ca. 2,6kg. \r\nprice (ohne Messkopf) 359,00 € Brutto', 66, 142, 7, '07.02.2014'),
(819, 197, 'R&S UHF-Belastungswiderstand RD010/50-50 Ohm', 1, 0, 'Rohde & Schwarz Belastungswiderstand100W, 0-600MHz, Dezifix B, 50 Ohm\r\n\r\nMaterial 	Metallausführung\r\nForm 	Tischmodell, Zusatz nicht bekannt - allgemein.\r\nAbmessungen (BHT) 	250 x 520 x 175 mm / 9.8 x 20.5 x 6.9 inch\r\nBemerkung 	Nennbelastbarkeit: 100 W;\r\nFrequenzbereich: 0...600 MHz;\r\nEingangswiderstand: 50 Ohm;\r\nWelligkeitsfaktor s bei 0...50 MHz: &#8804;1,05, bei 50...600 MHz: &#8804;1,1;\r\nMax. Impuls-Spannung: 2000 V;\r\nAnschluss: Kurzhubstecker Dezifix B, umrüstbar auf andere Stecker- oder Buchsensysteme.\r\nKühlung: Luftkonvektion.\r\nNettogewicht 	7.2 kg / 15 lb 13.7 oz (15.859 lb) ', 66, 142, 7, '19.01.2014'),
(820, 197, 'R&S UHF-Belastungswiderstand  RD010/60-60 Ohm', 1, 0, 'Rohde und Schwarz Belastungswiderstand 100W-Bundeswehr, robust, kann kurzzeitig mit 600W  belastet werden , 1-600Mhz, Dezifix B Connector 60Ohm, Passive Kühlung durch Konvektion, also kein Lüfterlärm! Optisch neuwertiger Eindruck!', 66, 147, 7, '2011'),
