(869, 36, 'Atmel ATMega328 Modul', 0, 0, 'Type #1:Atmega328 5V 16M Replace ATmega128 For Arduino Compatible Nano\r\n\r\nSize:Length33mm *Wide18 mm *High3mm\r\n\r\nATmega328 running at 16MHz with external resonator (0.5% tolerance)\r\nUSB connection off board\r\nSupports auto-reset\r\nMax 150mA output\r\nOver current protected\r\nReverse polarity protected\r\nDC input 5V up to 12V\r\nOn board Power and Status LEDs\r\n\r\nPins (Beschriftung): \r\nRXD = PD0/RXD (2x auf Platine als Pin vorhanden)\r\nTXD = PD1/TXD (2x)\r\n2 = PD2\r\n3 = PD3\r\n4 = PD4\r\n5 = PD5\r\n6 = PD6\r\n7 = PD7\r\n8 = PB0\r\n9 = PB1\r\n10 = PB2\r\n11 = PB3\r\n12 = PB4\r\n13 = PB5\r\nA0 = PC0/ADC0\r\nA1 = PC1/ADC1\r\nA2 = PC2/ADC2\r\nA3 = PC3/ADC3\r\nA4 = PC4/ADC4\r\nA5 = PC5/ADC5\r\nA6 = ADC6\r\nA7 = ADC7\r\nRST = PC6/RESET (2x)\r\nGND = GND (5x)\r\nVCC (kurze Kante) = VCC in mit Verpolschutzdiode\r\nVCC (lange Kante) = VCC out ohne Verpolschutzdiode\r\nDTR = RST mit 100nF Kondensator in Reihe\r\n\r\nN/A:\r\nADC6, ADC7', 37, 13, 7, 'easydeal365'),
(870, 204, 'NRF24L01+ 2.4GHz Wireless Transceiver Modul', 8, 0, 'MuitiCwiver hardware provides the function of six receivers\r\nLink layer within makes the software design more simple\r\n2Mbit/s makes it possible for the high quality VoIP\r\n2Mbit/s 1Mbit/s 250Kbit/s three optional transmission rate\r\nFew peripheral components make it possible for low cost\r\n+/- 60 ppm crystals\r\nNeed external inductance only in antenna matching place\r\nNo need for multi layer PCB\r\n5V level imput\r\nNo need for external level translator\r\nImproved ShockBurst and UART are easy to connect with all kinds of low cost\r\nMCU MCU needs no external level\r\n20 pin 4x4mm QFN lead-free package\r\nPeak current received at 2Mbit/s is 12.5mA\r\nPeak current of @0dBm output at\r\n2Mbit/s is 11mA 2Mbit/s needs small average current\r\nPower consumption is 400mA in power down mode\r\nPower consumption is 32uA in idle mode\r\nQuick switch and wake-up time:130us\r\nCan work in low voltage between 1.9V to 3.6V\r\n\r\nFunkmodul', 42, 15, 7, 'easydeal365'),
