(1113, 204, 'ESP8266 Wifi Funkmodul', 10, 0, 'Warnungen:\r\n&#9679; Dieses Modul benötigt eine 3,3-Volt-Versorgung für VCC und 3,3 V-Logik. Es ist nicht 5V tolant. Schließen RX oder TX auf 5V Arduino wird\r\nzerstöre diese Modul. Sie müssen einen Logikpegelwandler oder eine 3.3V Arduino nutzen\r\n&#9679; Die 3,3V-Versorgung auf der Arduino Uno hat unzureichende Strom leistunge um dieses Modul zu betreiben. Sie müssen eine separate,\r\nhöhere 3,3 V (über 300 mA oder besser)\r\n\r\nEigenschaften:\r\n&#9679; SDIO 2.0, SPI, UART\r\n&#9679; Integrierter HF-Schalter, Balun, 24dBm PA, DCXO und PMU\r\n&#9679; Integrierter RISC-Prozessor, Speicher auf dem Chip und externen Speicherschnitt\r\n&#9679; Integrierte MAC / Basisband-Prozessoren\r\n&#9679; I2S-Schnittstelle für High-Fidelity-Audio-Anwendungen\r\n&#9679; On-Chip-Low-Dropout-Linearregler für alle internen Lieferungen\r\n&#9679; Proprietäre Architektur störungsfreien Takterzeugung\r\n&#9679; Integriertes WEP, TKIP, AES und WAPI-Motoren\r\n\r\nTechnische Daten:\r\n&#9679; 802.11 b / g / n\r\n&#9679; Wi-Fi Direct (P2P), Soft-AP\r\n&#9679; Integrierter TCP / IP-Protokoll-Stack\r\n&#9679; Integrierter Fahrstufenschalter, Balun, LNA, Leistungsverstärker und Anpassungsnetzwerk\r\n&#9679; Integrierter PLLs, Regulierungsbehörden, DCXO und Power-Management-Einheiten\r\n&#9679; + 19.5dBm Ausgangsleistung im 802.11b-Modus\r\n&#9679; Schalten Sie Leckstrom von <10uA\r\n&#9679; Integrierte Low-Power 32-Bit-CPU könnte als Applikations-Prozessor verwendet werden,\r\n&#9679; SDIO 1.1 / 2.0, SPI, UART\r\n&#9679; STBC, 1 × 1 MIMO, 2 × 1 MIMO\r\n&#9679; A-MPDU & A-MSDU Aggregation & 0.4ms Schutzintervall\r\n&#9679; Wach auf und übermitteln Pakete in <2ms\r\n&#9679; Standby-Stromverbrauch von <1.0mW (DTIM3)\r\n&#9679; lwIP Abkommen\r\n&#9679; Unterstützung 3 Modi: AP, STA, AP + STA\r\n&#9679; Perfekte und einfache AT-Befehle', 42, 190, 7, '322359324501'),
(1114, 204, 'MP1584EN DC-DC Buck', 4, 0, 'Super mini MP1584EN DC-DC BUCK Adjustable Step Down Module Effect Higher Than LM2596\r\n\r\nModel Name:  Ultra-small DC-DC step-down module\r\nInput Voltage: 4.5V ~ 28V\r\nOutput voltage: 0.8V ~ 20V\r\nOutput Current: 3A (Max)\r\nConversion efficiency: 92% (maximum)\r\nOutput Ripple: <30mV\r\nSwitching frequency: 1.5MHz (highest) typically 1MHz\r\nOperating Temperature: -45 &#8451; ~ +85 &#8451;\r\nSize: 22mm * 17mm * 4mm (L * W * H)', 42, 190, 7, '380857009378'),
