(1116, 191, 'Spannungsregler ST L4931 C33 ', 4, 0, 'Low-Drop (0,4V) Spannungsregler\r\n\r\nFeatures\r\n• Very low dropout voltage (0.4 V)\r\n• Very low quiescent current\r\n• Typ. 50 µA in OFF mode, 600 µA in ON mode\r\n• Output current up to 250 mA\r\n• Logic controlled electronic shutdown\r\n• Output voltages: 2.7; 3.3; 3.5; 5; 8; 12 V\r\n• Automotive-grade product: 2.7 V, 3.3 V VOUT in\r\nSO-8 package only\r\n• Internal current and thermal limit\r\n• Only 2.2 µF for stability\r\n• Available in ± 1% (AB) or 2% (C) selection at 25\r\n°C\r\n• Supply voltage rejection: 70 dB typ. for 5 V\r\nversion\r\n• Temperature range: from -40 to 125 °C', 59, 190, 1, ''),
