(1216, 204, 'MOSFET Trigger-Switch Gleichstrom Modul', 4, 0, 'Material: Electrical components   \r\n\r\nColor: See pictures   \r\n\r\nModule Highlights:\r\n    1. The use of imported dual-MOS parallel active output, lower resistance, more current, strong power at room temperature, 15A, 400W, to meet the most use of the equipment\r\n    2. Wide voltage, the perfect support for PWM\r\n    3. Easily control high power devices\r\n    Product specifications and applications:\r\n    1: Operating Voltage: DC 5V - 36V;\r\n    2: The trigger source: digital high-low (DC3.3V - 20V), can be connected microcontroller IO port, PLC interfaces,\r\n    DC power, you can access the PWM signal, the signal frequency 0--20KHZ perfect support.\r\n    3: output capacity: DC DC 5V - 36V, at room temperature, continuous current 15A, power 400W! Lower auxiliary\r\n    cooling conditions, the maximum current up to 30A.\r\n    4: Applications: You can control the output of power equipment, motors, light bulbs, LED lights, DC motors, micro-pumps,\r\n    solenoid valves, etc., you can enter\r\n    PWM, motor speed control, lamp brightness.\r\n    5: Availability: unlimited switch; Operating temperature: -40-85 ;\r\n    Size: See the picture\r\n    Quantity:1Pc\r\n    No retail package\r\n    Note: Due to the difference between different monitors, the picture may not reflect  the actual color of the item. Thank you!!', 42, 190, 7, '272442848827'),
(1217, 204, 'HD44780 Blaues Hintergrundlicht LCD 20x4 Zeichen 5V', 1, 0, '1. The module is a low-power consumption character LCD Module with a built-in controller.\r\n2. The module can be easily interfaced with a MCU.\r\n3. Display Format: 20 Characters x 4 lines.\r\n4. It is fantastic for Arduino based project.\r\n5. Supply voltage: 5V.\r\n6. Fully assembled and tested Serial LCD 20x4 Module.\r\n7. White Text, Blue backlight.\r\n8. Analog Interface.\r\n9. Size: 98 x 60 x 12mm.', 42, 190, 7, '272511024528'),
