(1220, 204, 'Logic Level Converter Bi-Direktional 5V auf 3.3V', 10, 0, 'If you’ve ever tried to connect a 3.3V device to a 5V system, you know what a challenge it can be. bi-directional logic level converter is a small device that safely steps down 5V signals to 3.3V AND steps up 3.3V to 5V at the same time. This level converter also works with 2.8V and 1.8V devices. What really separates this Logic level converter from our previous versions is that you can successfully set your high and low voltages and step up and down between them safely on the same channel. Each level converter has the capability of converting 4 pins on the high side to 4 pins on the low side with two inputs and two outputs provided for each side.\r\nThe level converter is very easy to use. The board needs to be powered from the two voltages sources (high voltage and low voltage) that your system is using. High voltage (5V for example) to the ‘HV’ pin, low voltage (3.3V for example) to ‘LV’, and ground from the system to the ‘GND’ pin.\r\n\r\nDimensions: 0.63 x 0.52" (16.05 x 13.33mm)\r\n\r\nPackage Included:\r\n\r\n2/5/10 x IIC I2C Logic Level Converter Bi-Directional Module 5V to 3.3V Arduino', 42, 190, 7, '272477197979'),
(1221, 204, 'MCP2515 CAN Bus Modul mit TJA1050 Transceiver 5V', 4, 0, '1, support CAN V2.0B specification, the communication speed 1Mb / S\r\n2,0 to 8-byte data field\r\n3, the standard frame and expand the frame and remote frame\r\n4. 5V DC power supply module, SPI interface protocol control\r\n5,120 ohm termination resistors. Impedance matching, ensure drive capacity,\r\n    long-distance data transmission against signal radiation\r\n6, module size: 4.4cm x 2.8cm screw hole center spacing 23mm x 38mm\r\n7, the working current: typ. 5mA, 1 microamp standby current. Except the power indicator.\r\n8, the working temperature: Industrial grade to 85 &#8451; -40 &#8451;', 42, 190, 7, '272438778454'),
(1222, 204, 'HC-ST505 PIR Infrarot Bewegungssensor', 2, 0, 'Product Overview:\r\n\r\nHC-SR505 small body sensing module is based on infrared technology, automatic control products, high sensitivity, high reliability, ultra-small, ultra-low-voltage operation mode. Widely used in various auto-sensing of electrical equipment, especially battery-powered automatic control products.\r\n\r\nTechnical parameters:\r\n\r\nOperating Voltage Range: DC4.5-20V\r\nStatic current: <60uA\r\nOutput level: High 3.3V / Low 0V\r\nTrigger: repeatable trigger (default)\r\nDelay time: Default 8S + -30% (can be customized range of a few tenths - tens of minutes)\r\nPCB Dimensions: 10 * 23mm\r\nInduction angle: <100 degree cone angle\r\nInduction distance: 3 meters\r\nWorking temperature: -20 - +80 degrees\r\nSensor Lens Dimensions: Diameter: 10mm (default)\r\n\r\nFeatures:\r\n\r\nAutomatic induction: to enter the sensing range of the output is high, people leave the sensor range automatically delay off high, output low. Ultra-small size.\r\nRepeatable trigger: the sensor output high, the delay period, if there is human activity in its sensing range, the output will remain high until people leave after the high variable delay lOW (automatically extended sensor module detects the human body after every activity a delay period, and the last time an event is the starting point of the delay time).\r\nWide operating voltage range: the default operating voltage DC4.5V-20V.\r\nMicropower: quiescent current <50 microamps, especially for battery-powered automatic control products.\r\nOutput high signal: easy docking and all kinds of circuits.', 42, 190, 7, '272450301974'),
