(1226, 204, 'GY-219 I2C Stromsensor ', 2, 0, 'This breakout board will solve all your power-monitoring problems. Instead of struggling with two multimeters, you can just use the handy INA219B chip \r\non this breakout to both measure both the high side voltage and DC current draw over I2C with 1% \r\nprecision.Most current-measuring devices such as our current panel meter are only good for low side measuring. That means that \r\nunless you want to get a battery involved, you have to stick the measurement resistor between the target \r\nground and true ground. This can cause problems with circuits since electronics tend to not like it when the \r\nground references change and move with varying current draw. This chip is much smarter - it can handle \r\nhigh side current measuring, up to +26VDC, even though it is powered with 3 or 5V. It will also report back\r\n that high side voltage, which is great for tracking battery life or solar panels.\r\nA precision amplifier measures the voltage across the 0.1 ohm, 1% sense resistor. Since the amplifier \r\nmaximum input difference is ±320mV this means it can measure up to ±3.2 Amps. With the internal 12 \r\nbit ADC, the resolution at ±3.2A range is 0.8mA. With the internal gain set at the minimum of div8, the \r\nmax current is ±400mA and the resolution is 0.1mA. Advanced hackers can remove the 0.1 ohm current \r\nsense resistor and replace it with their own to change the range (say a 0.01 ohm to measure up 32 Amps \r\nwith a resolution of 8mA)\r\nWe include a 6-pin header (so you can easily attach this sensor to a breadboard) as well as a 3.5mm \r\nterminal plug so you can easily attach and detach your load. Usage is simple. Power the sensor itself with \r\n3 to 5VDC and connect the two I2C pins up to your microcontroller. Then connect your target power supply\r\n to VIN+ and the load to ground to VIN-. We have an Arduino library right now that will do all the gain, \r\nrange and math for you - just plug and go! We''ll have a more detailed tutorial up shortly.\r\nSpecification:\r\nUses the INA219B chip\r\n0.1 ohm 1% 2W current sense resistor\r\nUp to +26V target voltage\r\nUp to ±3.2A current measurement, with ±0.8mA resolution\r\nThis board ip uses I2C 7-bit addresses 0x40, 0x41, 0x44, 0x45, selectable with jumpers', 42, 190, 7, '272503189551'),
(1227, 204, 'GY-BME280-3.3V Drucksensor Feuchtesensor Temperatursensor', 4, 0, 'ME-BME280 is a Breakout Board featuring a Bosch Sensortec ME280 Temperature, Humidity & Pressure Sensor.\r\nThe board has selectable I2C address jumper (solder link GS2), I2C pull-up resistors, 7 pin header 2.54mm, and two mounting holes 3.5mm.\r\nDefault setting of the board; single power rail Vdd=Vdd_IO (solder link GS1), pull-ups resistors (R2, R3) 10k, protocol selector resistor 0ohm (R1), decoupling capacitors 0.1uF on both power supply pins Vdd & Vdd_IO.\r\nIf you connect board to both power rails VDD_IO 1.8V and VDD 3.3V be sure to remove the power rail jumper GS1!\r\nBME280 Features\r\nPackage 2.5 mm x 2.5 mm x 0.93 mm metal lid LGA\r\nDigital interface I2C (up to 3.4 MHz) and SPI (3 and 4 wire, up to 10 MHz)\r\nSupply voltage VDD main supply voltage range: 1.71 V to 3.6 V\r\nVDDIO interface voltage range: 1.2 V to 3.6 V\r\nCurrent consumption 1.8 uA @ 1 Hz humidity and temperature\r\n2.8 uA @ 1 Hz pressure and temperature\r\n3.6 uA @ 1 Hz humidity, pressure and temperature\r\n0.1 uA in sleep mode\r\nOperating range -40…+85 C, 0…100 % rel. humidity, 300…1100 hPa- Humidity sensor and pressure sensor can be independently enabled/disabled', 42, 190, 7, '272458751878'),
