(1231, 204, 'AM2302 Temperatursensor Feuchtigkeitssensor', 6, 0, 'Description:\r\n\r\nType:AM2302\r\nAccuracy resolution:0.1\r\nHumidity range:0-100%RH\r\nTemperature range:-40~80?\r\nHumidity measurement precision:±2%RH\r\nTemperature measurement precision:±0.5?\r\nultra-low power\r\nNo additional components\r\nexcellent long-term stability\r\nAll calibration, digital output\r\ncompletely interchangeable\r\nlong distance signal transmission\r\nrelative humidity and temperature measurement.', 42, 211, 7, '381765119819'),
