(1234, 204, 'Arduino Pro Mini', 5, 0, 'The Arduino Pro Mini is a microcontroller board based on the ATmega328. \r\nIt has 14 digital input/output pins (of which 6 can be used as PWM outputs), 6 analog inputs, an on-board resonator, a reset button, and holes for mounting pin headers. A six pin header can be connected to an FTDI cable or Sparkfun breakout board to provide USB power and communication to the board.\r\nThe Arduino Pro Mini is intended for semi-permanent installation in objects or exhibitions. The board comes without pre-mounted headers, allowing the use of various types of connectors or direct soldering of wires. The pin layout is compatible with the Arduino Mini. \r\nThere are two version of the Pro Mini. One runs at 3.3V and 8 MHz, the other at 5V and 16 MHz. \r\nThe Arduino Pro Mini was designed and is manufactured by SparkFun Electronics.', 42, 190, 7, '172128868891'),
(1235, 235, 'USBASP USBISP AVR Programmer USB mit 10pin auf 6pin Adapter', 2, 0, 'PCB board size: 35(mm) x20 (mm)/1.37''''x0.78''''\r\nThe ISP interface converter can be used Arduino development board.\r\nAVR MCU development board can be used to download interface converter.\r\nThe AVRISP USBASP STK500 programmer standard interface to standard 6PIN 10PIN Interface Converte\r\n Package Included:1 x 10 Pin Convert to Standard 6 Pin Adapter Board ATMEL AVRISP USBASP STK500\r\n\r\nMit diesem kostengünstigen USBASP AVR Programmer können über eine ISP Schnittstelle Atmel Mikrocontroller programmiert werden. Der Programmer wird via USB Anschluss an den PC angeschlossen. Die 10 polige ISP Schnittstelle ist dank Flachbandkabel Flexibel einsetzbar. Die Programmierspannung lässt sich über einen Jumper von 3V3 auf 5V ändern. Dieser USBASP AVR Programmer sollte bei keinem Programmierer fehlen.\r\nDetails:\r\n    10-poliger ISP-Anschluss zur Verbindung zum Ziel\r\n    Programmierspannung per Jumper umschaltbar (5V/3,3V)\r\nLieferumfang:1 x USBASP AVR Programmer, Anschlussleitung zum ISP-Interface.', 42, 190, 7, '272443942701'),
(1236, 235, 'ESP-01 ESP8266 USB Programmieradapter', 1, 0, 'Specifications:\r\nCondition:new\r\nColor: blue\r\nSize: 4.8*3.5cm\r\nWeight: 5.4g', 42, 190, 7, '272461294802'),
(1237, 235, 'ESP-01 ESP8266 Breakout Board', 1, 0, 'This is a breadboard adapter for the popular ESP-01 model of the ESP8266 serial-to-WiFi transceiver module.\r\nAs ESP-01 Pin arrangements are not breadboard friendly and are not labeled, which makes it little inconvenient for rapid prototyping.This breadboard adapter will help you to make\r\nprototyping with esp-01 module much more easier.\r\nThis breakout conveniently offers clear pinout silkprint on top and will nicely fit your prefered breadboard.\r\nLast but not least, we added a 0.1µF decoupling capacitor so the ESP-01 will always run smoothly and without a hitch.\r\nConnection:\r\nURAT        Adapter\r\n3.3V           VCC\r\n3.3V           CH-PD\r\nTX               RX\r\nRX              TX\r\nChoose both NL CR 15200 baud rate', 42, 190, 7, '272461332256'),
